import React from 'react';
import Container from './Container';
import classes from './Header.module.sass';
import {Link} from "react-router-dom";
const Header = () => {
    return (
        <div className={classes.Header}>
            <Container inner = {
                <>
                    <Link to={"/"}>О нас</Link>
                </>
            }/>
        </div>
    );
};

export default Header;
